INSERT INTO `step` (`StepNum`, `Username`, `RecipeName`, `Instruction`) VALUES
(1, 'meecah', 'Pork Adobo (Marilyn Version)', 'Cut pork and potaoes in pieces. Crush the garlic.'),
(2, 'meecah', 'Pork Adobo (Marilyn Version)', 'Add 1.5 Litres to the pot. Then add pork, potatoes, garlic, and bayleaves.'),
(3, 'meecah', 'Pork Adobo (Marilyn Version)', 'Season with 2 TBSP soysauce, pepper, chinese crack, and 2 good sprinkle of filo crack. Mix.'),
(4, 'meecah', 'Pork Adobo (Marilyn Version)', 'When \"yucky foam is gone\" -connor, taste your sauce. Season to taste with soysauce and/or filo crack.'),
(5, 'meecah', 'Pork Adobo (Marilyn Version)', 'Simmer until you can cut the pork with you spoon.'),
(6, 'meecah', 'Pork Adobo (Marilyn Version)', 'Boil your egg. Separate the meat from the sauce.'),
(7, 'meecah', 'Pork Adobo (Marilyn Version)', 'Sear the meat. Season with 1 sprinkle of filo crack, 2 squirt of soysauce, and 1 actual spoon of vinegar. Sear until browm'),
(8, 'meecah', 'Pork Adobo (Marilyn Version)', 'Add a little bit of the sauce to the meat. Let meat absorb the sauce.'),
(9, 'meecah', 'Pork Adobo (Marilyn Version)', 'Put everything back to the pot. Add 1 actual spoon of vinegar. Season to taste.'),
(10, 'meecah', 'Pork Adobo (Marilyn Version)', 'Serve with rice.'),
